import React from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import { TextField } from '@material-ui/core';
import rows from './../data/TableData';
const styles = {
    header: {
        fontSize: 15,
        color: "black",
        fontWeight: "bold",
        padding: 1,
    },
    year: {
        backgroundColor: "#FFE4C470",
        padding: 1,
    },
    TextField: {
        height: '100%',
        width: '100%'
    }
}

export default class DataTable extends React.Component {
    _changeTextField = (value, data, id) => {
        value = value.target.value;
        alert(id)
    }
    render() {
        return (
            <TableContainer >
                <Table aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell align="center" style={styles.header}>Punktart</TableCell>
                            <TableCell align="center" style={styles.header}>Ein-/Ausspeisung (Bitte Angaben als Brennwert)</TableCell>
                            <TableCell align="center" style={styles.header}>Einheit</TableCell>
                            <TableCell align="center" style={styles.header}>2023</TableCell>
                            <TableCell align="center" style={styles.header}>2024</TableCell>
                            <TableCell align="center" style={styles.header}>2025</TableCell>
                            <TableCell align="center" style={styles.header}>2026</TableCell>
                            <TableCell align="center" style={styles.header}>2027</TableCell>
                            <TableCell align="center" style={styles.header}>2028</TableCell>
                            <TableCell align="center" style={styles.header}>2029</TableCell>
                            <TableCell align="center" style={styles.header}>2030</TableCell>
                            <TableCell align="center" style={styles.header}>2031</TableCell>
                            <TableCell align="center" style={styles.header}>2032</TableCell>
                            <TableCell align="center" style={styles.header}>2040</TableCell>
                            <TableCell align="center" style={styles.header}>2050</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>

                        {Object.keys(rows).map((row, index) => (
                            <TableRow key={index}>
                                <TableCell align="center">{rows[row].punktart}</TableCell>
                                <TableCell align="center">{rows[row].einAusspeisung}</TableCell>
                                <TableCell align="center">{rows[row].einheit}</TableCell>
                                <TableCell align="center" style={styles.year}><TextField id={"zweidrei"} value={rows[row].zweidrei} onChange={(text) => this._changeTextField(text, rows[row], this.id)} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].zweivier} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].zweifuenf} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].zweisechs} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].zweiseben} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].zweiacht} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].zweineun} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].dreinull} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].dreieins} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].dreizwei} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].viernull} /></TableCell>
                                <TableCell align="center" style={styles.year}><TextField value={rows[row].fuenfnull} /></TableCell>
                            </TableRow>

                        ))}
                    </TableBody>
                </Table >
            </TableContainer >
        )
    }
}
